import React, { useContext } from 'react'
import noteContext from '../context/noteContext'

const Home = () => {
  const context=useContext(noteContext)
  const {notes,setNotes}=context
  return (
    <div>
      <div>
        <h2>your notes</h2>
         {
          notes.map((note)=>{
            <div> <br /></div>
            return note.title 
            
          })
         }
      </div>
    </div>
  )
}

export default Home
